import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './contexts/AuthContext';
import Navbar from './components/Navbar';
import Home from './pages/Home';
import Login from './pages/Login';
import Register from './pages/Register';
import JobListing from './pages/JobListing';
import JobDetails from './pages/JobDetails';
import ApplicationForm from './pages/ApplicationForm';
import ApplicantDashboard from './pages/ApplicantDashboard';
import EmployerDashboard from './pages/EmployerDashboard';
import PostJob from './pages/PostJob';
import ManageJobs from './pages/ManageJobs';
import ViewApplications from './pages/ViewApplications';
import About from './pages/About';
import Contact from './pages/Contact';
import PrivacyPolicy from './pages/PrivacyPolicy';
import TermsOfService from './pages/TermsOfService';
import Profile from './pages/Profile';

function App() {
  return (
    <AuthProvider>
      <BrowserRouter>
        <Navbar />
        <Routes>
          <Route path='/' element={<Home />} />
          <Route path='/login' element={<Login />} />
          <Route path='/register' element={<Register />} />
          <Route path='/jobs' element={<JobListing />} />
          <Route path='/jobs/:id' element={<JobDetails />} />
          <Route path='/apply/:jobId' element={<ApplicationForm />} />
          <Route path='/dashboard' element={<ApplicantDashboard />} />
          <Route path='/employer/dashboard' element={<EmployerDashboard />} />
          <Route path='/post-job' element={<PostJob />} />
          <Route path='/manage-jobs' element={<ManageJobs />} />
          <Route path='/applications/:jobId' element={<ViewApplications />} />
          <Route path='/profile' element={<Profile />} />
          <Route path='/about' element={<About />} />
          <Route path='/contact' element={<Contact />} />
          <Route path='/privacy-policy' element={<PrivacyPolicy />} />
          <Route path='/terms-of-service' element={<TermsOfService />} />
        </Routes>
        <footer className="footer-glass mt-5 py-4">
          <div className="container-smash text-center">
            <div className="row">
              <div className="col-md-4">
                <h6 className="fw-bold">Online Job Portal</h6>
                <p className="small">Find your dream job or hire the best talent</p>
              </div>
              <div className="col-md-4">
                <h6 className="fw-bold">Quick Links</h6>
                <div className="d-flex flex-column small">
                  <a href="/about" className="text-decoration-none mb-1">About Us</a>
                  <a href="/contact" className="text-decoration-none mb-1">Contact</a>
                  <a href="/privacy-policy" className="text-decoration-none mb-1">Privacy Policy</a>
                  <a href="/terms-of-service" className="text-decoration-none">Terms of Service</a>
                </div>
              </div>
              <div className="col-md-4">
                <h6 className="fw-bold">Connect With Us</h6>
                <div className="d-flex justify-content-center gap-3">
                  <a href="#" className="text-decoration-none">üê¶</a>
                  <a href="#" className="text-decoration-none">üíº</a>
                  <a href="#" className="text-decoration-none">üìò</a>
                </div>
              </div>
            </div>
            <hr className="my-3" style={{opacity: 0.2}} />
            <small>¬© {new Date().getFullYear()} Online Job Portal. All rights reserved.</small>
          </div>
        </footer>
      </BrowserRouter>
    </AuthProvider>
  );
}

export default App;
